import React from "react"
import loader from '../assets/img/preloader/805.gif'

const Preloader = () => {
    return (
        <div style={{display:"flex", flexDirection:"column", justifyContent:"center", width: "50px"}}>
            <img src={loader}/>
        </div>
    )
}

export default Preloader
